import React from "react";
import "./ListStyles.css";

const ElementsList = () => {
    return(
    <ul className="listStyles">
        <li>First component</li>
        <li>Second component</li>
        <li>Third component</li>
        <li>Fourth component</li>
    </ul>
    );
};

export default ElementsList;
